<!DOCTYPE html>
<html>
<head>
    <style>
        html, body{
            margin: 0px;
        }
        .main_map{
            width: 900px;
            height: 530px;
            margin: auto;
            background-image: url('/images/VK/new/fon.jpg');
        }

        .right-container{
            width: 210px;
            height: 100%;
            #background: #fff;
        }

        .l{
            float:left;
        }

        .r{
            float:right;
        }

        .right-container .container-user{
            width: 100%;
            height: 130px;
            #border-bottom: 1px solid black;
        }

        .right-container .container-user .container-info{
            background: #eee;
            width:94.8%;
            margin: 2.2%;
        }

        .right-container .container-user .container-info .container-nick{
            width: calc(100% - 78px);
            height: 18px;
            padding: 4px;
            background: #2a88bd;
            color: #fff;
            font-size:16px;
            font-weight: bold;
            text-align: center;
        }

        .right-container .container-user .container-info  .container-avatar{
            width: 70px;
            height: 70px;
        }

        .right-container .container-user .container-info .container-avatar img{
            width: 100%;
            height: 100%;
        }

        .cave{
            background-image: url(data:image/gif;base64,);
            background-size: 100%;
            width: 180px;
            height: 180px;
            margin-top: 344px;
            margin-left: 38px;
            margin-right: 10px;
            cursor: pointer;
        }
    </style>
</head>
<body>
<div class="main_map">
    <div class="cave l" title="Пещера"></div>
    <div class="right-container r">
        <div class="container-user l">
            <div class="container-info l">
                <div class="container-avatar l">
                    <img src="https://pp.vk.me/c629207/v629207129/1faee/im1l-8Rift0.jpg"/>
                </div>
                <div class="container-nick l">TRIUMF</div>
            </div>
        </div>
    </div>
</div>
</body>
</html>